import React from 'react'
import { Link } from 'react-router-dom'


function Header() {
    return (
        <header>
            <div>
                <Link to='/'>Pagina Programador</Link>
            </div>
            <div>
                <Link to='/Login'>Entrar</Link>
            </div>
        </header>
    )
}

export default Header;
